import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import styled from "styled-components";
import { Avatar } from "@material-ui/core";
import {
  Container,
  Text,
  CaptionText,
  SubText,
  Header,
  SubHeader
} from "../../styledComponents";
import hasLogo from "../../../public/static/HAS.png";

const useStyles = makeStyles(theme => ({
  small: {
    width: theme.spacing(10),
    height: theme.spacing(10),
    borderRadius: 0,
    backgroundColor: "transparent",
    border: 0
  }
}));
const HeaderSection = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  padding: 30px 110px;
  background-color: white;
`;
const ContentSection = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
`;
const Tag = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-radius: 20px;
  background-color: #e1e1e1;
  padding: 4px 15px;
  margin: 0px 2px;
`;
const SingleHouse = () => {
  const classes = useStyles();
  return (
    <Container flex={1}>
      <HeaderSection>
        <Container flex={false} color="transparent">
          <Avatar src={hasLogo} className={classes.small} />
        </Container>
        <Container
          flex={1}
          column
          customStyles={{ paddingLeft: 40, paddingTop: 5 }}
        >
          <Header customStyles={{ fontWeight: 400, marginBottom: 0 }}>
            Barcelona
          </Header>
          <SubText customStyles={{ color: "#979a9a" }}>
            KGN606 St. KIGALI, GA 30338, RWANDA
          </SubText>
          <Container column customStyles={{ paddingTop: 7, paddingBottom: 10 }}>
            <SubText>last updated 20-March-2020</SubText>
          </Container>
          <Container column customStyles={{ paddingTop: 7, paddingBottom: 10 }}>
            <Tag>has Tenant</Tag>
          </Container>
        </Container>
      </HeaderSection>
      <ContentSection></ContentSection>
    </Container>
  );
};

export default SingleHouse;
